import "./ImageApi.css"
import axios from 'axios'
function ImageApi() {
    const [images, setImages]=useState([])
    const getImages = async ()=> { 
        try {
            const res =  await axios.get('https://picsum.photos/seed/picsum/200/300')
          const imgData =res.data
          setImages(imgData)
          console.log(imgData)
            
        } catch (error) {
         console.error("Error in fetching Image")   
        }



    }
  return (
    <div>
      <h1>Welcome</h1>
      <button className='btn' onClick={getImages}>Get Images</button>

      {
images.map((elem, id)=>{

    <div className='ApiImages' key={id}>
        <img src={elem.download_url} alt="" />
        <h1>{elem.author}</h1>
    </div>
})
      }
    </div>
    
  )
}

